import React, { useState, useEffect } from "react";
import { Grid, Card, CardContent, Typography, IconButton } from "@mui/material";
import AddIcon from "@mui/icons-material/Add";
import EditIcon from "@mui/icons-material/Edit";
import DeleteIcon from "@mui/icons-material/Delete";

const mockVideos = [
  { id: 1, title: "Video 1" },
  { id: 2, title: "Video 2" },
  { id: 3, title: "Video 3" }
];

function Video() {
  const [videos, setVideos] = useState([]);

  // Fetch videos (mock data for demonstration)
  useEffect(() => {
    setVideos(mockVideos);
  }, []);

  const handleAddVideo = () => {
    // Add functionality to add a new video
    const newVideo = { id: Math.random(), title: `New Video ${videos.length + 1}` };
    setVideos([...videos, newVideo]);
  };

  const handleEditVideo = (id) => {
    // Add functionality to edit a video
    console.log(`Editing video with ID ${id}`);
  };

  const handleDeleteVideo = (id) => {
    // Add functionality to delete a video
    setVideos(videos.filter((video) => video.id !== id));
  };

  return (
    <Grid container spacing={3}>
      {videos.map((video) => (
        <Grid item xs={12} sm={6} md={4} lg={3} key={video.id}>
          <Card>
            <CardContent>
              <Typography variant="h6" component="div">
                {video.title}
              </Typography>
              <IconButton onClick={() => handleEditVideo(video.id)}>
                <EditIcon />
              </IconButton>
              <IconButton onClick={() => handleDeleteVideo(video.id)}>
                <DeleteIcon />
              </IconButton>
            </CardContent>
          </Card>
        </Grid>
      ))}
      <Grid item xs={12} sm={6} md={4} lg={3}>
        <Card>
          <CardContent>
            <IconButton onClick={handleAddVideo}>
              <AddIcon />
            </IconButton>
            <Typography variant="subtitle1" component="div">
              Add Video
            </Typography>
          </CardContent>
        </Card>
      </Grid>
    </Grid>
  );
}

export default Video;
